css:
/* Professional Corporate Styling */
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif;
    background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
    min-height: 100vh;
    padding: 40px 20px;
    color: #2d3748;
    line-height: 1.6;
}

.report-container {
    max-width: 1400px;
    margin: 0 auto;
    background: white;
    border-radius: 12px;
    box-shadow: 0 20px 60px rgba(0,0,0,0.3);
    overflow: hidden;
}

.report-header {
    background: linear-gradient(135deg, #2d3748 0%, #1a202c 100%);
    color: white;
    padding: 40px 50px;
    border-bottom: 4px solid #667eea;
}

.report-header > span {
    font-size: 2.5em;
    font-weight: 300;
    letter-spacing: -0.5px;
    margin-bottom: 20px;
    color: white;
    display: block;
}

.metadata {
    display: flex;
    gap: 40px;
    font-size: 0.95em;
    color: #cbd5e0;
    margin-top: 15px;
}

.metadata > div {
    display: flex;
    align-items: center;
}

.metadata > div::before {
    content: '▪';
    margin-right: 10px;
    color: #667eea;
    font-size: 1.5em;
}

.table-wrapper {
    padding: 50px;
    background: #f7fafc;
}

table {
    width: 100%;
    border-collapse: separate;
    border-spacing: 0;
    background: white;
    border-radius: 8px;
    overflow: hidden;
    box-shadow: 0 4px 6px rgba(0,0,0,0.07);
}

thead {
    background: linear-gradient(135deg, #4a5568 0%, #2d3748 100%);
    color: white;
}

th {
    padding: 18px 16px;
    text-align: left;
    font-weight: 600;
    font-size: 0.85em;
    text-transform: uppercase;
    letter-spacing: 0.5px;
    border-bottom: 3px solid #667eea;
    position: sticky;
    top: 0;
    z-index: 10;
}

td {
    padding: 16px;
    border-bottom: 1px solid #e2e8f0;
    font-size: 0.95em;
}

tbody tr {
    transition: all 0.2s ease;
}

tbody tr:hover {
    background: #edf2f7;
    transform: scale(1.001);
    box-shadow: 0 2px 8px rgba(0,0,0,0.08);
}

tbody tr:last-child td {
    border-bottom: none;
}

.package-name {
    font-weight: 600;
    font-size: 1.05em;
}

.package-name a {
    color: inherit;
    text-decoration: none;
    transition: all 0.2s ease;
    display: inline-flex;
    align-items: center;
}

.package-name a:hover {
    color: #667eea;
}

.package-name a::after {
    content: '→';
    margin-left: 6px;
    opacity: 0;
    transition: all 0.2s ease;
}

.package-name a:hover::after {
    opacity: 1;
    margin-left: 8px;
}

.package-name-ok {
    color: #38a169;
}

.package-name-warning {
    color: #dd6b20;
}

.package-name-error {
    color: #e53e3e;
}

.status-ok {
    color: #38a169;
    font-weight: 600;
}

.status-warning {
    color: #dd6b20;
    font-weight: 600;
}

.status-error {
    color: #e53e3e;
    font-weight: 600;
}

.status-skip {
    color: #a0aec0;
    font-style: italic;
}

.status-external {
    color: #718096;
}

.version {
    color: #718096;
    font-size: 0.9em;
    font-family: 'Courier New', monospace;
    background: #edf2f7;
    padding: 2px 8px;
    border-radius: 4px;
    display: inline-block;
}

span[title] {
    cursor: help;
    position: relative;
    border-bottom: 1px dotted #cbd5e0;
}

span[title]:hover {
    border-bottom-color: #667eea;
}

span[title]:hover::after {
    content: attr(title);
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    bottom: calc(100% + 10px);
    background: linear-gradient(135deg, #2d3748 0%, #1a202c 100%);
    color: white;
    padding: 12px 16px;
    border-radius: 8px;
    white-space: pre-wrap;
    z-index: 1000;
    font-size: 0.85em;
    box-shadow: 0 10px 25px rgba(0,0,0,0.3);
    max-width: 400px;
    text-align: left;
    line-height: 1.5;
    border: 1px solid #667eea;
    animation: tooltip-appear 0.2s ease;
}

span[title]:hover::before {
    content: '';
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    bottom: 100%;
    border: 6px solid transparent;
    border-top-color: #2d3748;
    z-index: 1001;
}

@keyframes tooltip-appear {
    from {
        opacity: 0;
        transform: translateX(-50%) translateY(5px);
    }
    to {
        opacity: 1;
        transform: translateX(-50%) translateY(0);
    }
}

/* Print styles for professional reports */
@media print {
    body {
        background: white;
        padding: 0;
    }

    .report-container {
        box-shadow: none;
        border-radius: 0;
    }

    .report-header {
        background: #2d3748;
        -webkit-print-color-adjust: exact;
        print-color-adjust: exact;
    }

    tbody tr:hover {
        background: white;
        transform: none;
    }
}
